import './components.css';
import { NavLink } from 'react-router-dom';
function LeftSideBar() {
	return (
		<div className='leftSidebar'>
			<NavLink className='navLinks' to='/dashboard'>
				DASHBOARD
			</NavLink>
			<NavLink className='navLinks' to='/transactions'>
				TRANSACTIONS
			</NavLink>
			<NavLink className='navLinks' to='/category'>
				CATEGORIES
			</NavLink>
			<NavLink className='navLinks' to='/account'>
				ACCOUNT
			</NavLink>
		</div>
	);
}
export default LeftSideBar;
